import React from "react";
import Header from "./Header";
import Posts from "./Posts";
import Side from "./Side";
import Footer from "./Footer";

export default function home() {
    return (
        <>
            <Header />
            <main id="main">
                <Posts />
                <Side />
            </main>
            <Footer />
        </>
    );
}
